import React from 'react';
import { Link } from 'react-router-dom';
export default function Header(){
return (
<header className="header">
<div className="container">
<h1>PG Connect</h1>
<nav>
<Link to="/">Home</Link>
<Link to="/login">Login</Link>
<Link to="/admin">Admin</Link>
</nav>
</div>
</header>
);
}
